import { useState, useEffect } from "react";

export default function App() {
  const today = new Date().toISOString().substring(0, 10);
  const [bookings, setBookings] = useState([]);
  const [form, setForm] = useState({
    date: today,
    first: "",
    second: "",
    third: "",
  });
  const [editField, setEditField] = useState(null); // 'first', 'second', 'third'
  const [editId, setEditId] = useState(null);
  const [searchDate, setSearchDate] = useState("");
  const BASE_URL = "http://localhost:3000/api/v1/bookings";

  // Fetch all bookings
  const fetchBookings = async () => {
    try {
      const res = await fetch(BASE_URL);
      const data = await res.json();
      setBookings(data);
    } catch (err) {
      console.error("Error fetching bookings:", err);
    }
  };

  useEffect(() => {
    fetchBookings();
  }, []);

  // Create booking
  const createBooking = async () => {
    try {
      const res = await fetch(BASE_URL, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(form),
      });
      if (!res.ok) throw new Error("Failed to create booking");
      await fetchBookings();
      resetForm();
    } catch (err) {
      console.error(err);
    }
  };

  // Update booking by ID (specific field only)
  const updateBookingField = async (id, field, value) => {
    try {
      const res = await fetch(`${BASE_URL}/id/${id}`, {
        method: "PUT",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ [field]: value }),
      });
      if (!res.ok) throw new Error("Failed to update booking");
      await fetchBookings();
      resetForm();
    } catch (err) {
      console.error(err);
    }
  };

  // Delete booking by ID
  const deleteBookingById = async (id) => {
    try {
      const res = await fetch(`${BASE_URL}/id/${id}`, { method: "DELETE" });
      if (!res.ok) throw new Error("Failed to delete booking");
      await fetchBookings();
    } catch (err) {
      console.error(err);
    }
  };

  // Delete bookings by DATE
  const deleteBookingByDate = async (date) => {
    try {
      const res = await fetch(`${BASE_URL}/date/${date}`, { method: "DELETE" });
      if (!res.ok) throw new Error("Failed to delete by date");
      await fetchBookings();
    } catch (err) {
      console.error(err);
    }
  };

  // Search bookings by DATE
  const searchBookingsByDate = async () => {
    try {
      const res = await fetch(`${BASE_URL}/date/${searchDate}`);
      if (!res.ok) {
        setBookings([]);
        return;
      }
      const data = await res.json();
      setBookings(data);
    } catch (err) {
      console.error(err);
    }
  };

  // Reset form
  const resetForm = () => {
    setForm({ date: today, first: "", second: "", third: "" });
    setEditId(null);
    setEditField(null);
  };

  // Handle form change
  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  return (
    <div style={{ padding: "2rem" }}>
      <h1>Bookings Manager</h1>

      {/* Form for Create */}
      <div style={{ marginBottom: "1rem" }}>
        <input
          type="date"
          name="date"
          value={form.date}
          onChange={handleChange}
        />
        <input
          name="first"
          placeholder="First"
          value={form.first}
          onChange={handleChange}
        />
        <input
          name="second"
          placeholder="Second"
          value={form.second}
          onChange={handleChange}
        />
        <input
          name="third"
          placeholder="Third"
          value={form.third}
          onChange={handleChange}
        />
        <button onClick={createBooking}>Add Booking</button>
      </div>

      {/* Search by Date */}
      <div style={{ marginBottom: "1rem" }}>
        <input
          type="date"
          value={searchDate}
          onChange={(e) => setSearchDate(e.target.value)}
        />
        <button onClick={searchBookingsByDate}>Search</button>
        <button onClick={fetchBookings}>Reset</button>
      </div>

      {/* Bookings Table */}
      <table border="1" cellPadding="8">
        <thead>
          <tr>
            <th>Date</th>
            <th>First</th>
            <th>Second</th>
            <th>Third</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {bookings.map((b) => (
            <tr key={b._id}>
              <td>{b.date ? b.date.substring(0, 10) : ""}</td>
              <td>
                {editId === b._id && editField === "first" ? (
                  <>
                    <input
                      value={form.first}
                      onChange={(e) =>
                        setForm({ ...form, first: e.target.value })
                      }
                    />
                    <button
                      onClick={() =>
                        updateBookingField(b._id, "first", form.first)
                      }
                    >
                      Save
                    </button>
                    <button onClick={resetForm}>Cancel</button>
                  </>
                ) : (
                  <>
                    {b.first}
                    <button
                      onClick={() => {
                        setEditId(b._id);
                        setEditField("first");
                        setForm({ ...form, first: b.first });
                      }}
                    >
                      Edit
                    </button>
                  </>
                )}
              </td>
              <td>
                {editId === b._id && editField === "second" ? (
                  <>
                    <input
                      value={form.second}
                      onChange={(e) =>
                        setForm({ ...form, second: e.target.value })
                      }
                    />
                    <button
                      onClick={() =>
                        updateBookingField(b._id, "second", form.second)
                      }
                    >
                      Save
                    </button>
                    <button onClick={resetForm}>Cancel</button>
                  </>
                ) : (
                  <>
                    {b.second}
                    <button
                      onClick={() => {
                        setEditId(b._id);
                        setEditField("second");
                        setForm({ ...form, second: b.second });
                      }}
                    >
                      Edit
                    </button>
                  </>
                )}
              </td>
              <td>
                {editId === b._id && editField === "third" ? (
                  <>
                    <input
                      value={form.third}
                      onChange={(e) =>
                        setForm({ ...form, third: e.target.value })
                      }
                    />
                    <button
                      onClick={() =>
                        updateBookingField(b._id, "third", form.third)
                      }
                    >
                      Save
                    </button>
                    <button onClick={resetForm}>Cancel</button>
                  </>
                ) : (
                  <>
                    {b.third}
                    <button
                      onClick={() => {
                        setEditId(b._id);
                        setEditField("third");
                        setForm({ ...form, third: b.third });
                      }}
                    >
                      Edit
                    </button>
                  </>
                )}
              </td>
              <td>
                <button onClick={() => deleteBookingById(b._id)}>
                  Del by ID
                </button>
                <button
                  onClick={() => deleteBookingByDate(b.date?.substring(0, 10))}
                >
                  Del by Date
                </button>
              </td>
            </tr>
          ))}
          {bookings.length === 0 && (
            <tr>
              <td colSpan="5" style={{ textAlign: "center" }}>
                No bookings found
              </td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
}
